import React from 'react';
// import '../App.css';
import {Button} from '../Button';
import './Socials.css';
import cover from './cover.png';

function Socials() {
    return (
        <div className="social-display">
            <table>
                <td>
                    <th><i class="fa-brands fa-instagram fa-3x"></i></th>
                </td>
                <td>
                <i class="fa-regular fa-envelope fa-3x"></i>
                </td>
            </table>
        <i class="fa-brands fa-instagram fa-3x"></i>
        <i class="fa-regular fa-envelope fa-3x"></i>
        <i class="fa-brands fa-amazon fa-3x"></i>
        </div>
        // <h1 className='social-display'>Instagram | Amazon | LinkTree</h1>
    )
}

export default Socials
